import { API } from "../constant/api";
import axios from "axios";

const serviceInfo = async () => {
    try {
        const response = await axios.get(`${API}/informations`);

        const res = response.data;

        return res;
      } catch (errors) {
        console.error(errors);
      }

}

export default serviceInfo;
